import React from "react";
import { VectorMap } from "react-jvectormap";


const handleClick = (event, code) => {
    console.log(`You have click ${code}`)
}
class App extends React.Component {

   changeBg=()=> {
        this.refs.map.setBackgroundColor('red');
    }

    render() {
        return (
            <div style={{height: '100%', width: '100%', paddingBlockStart: '10px', position: 'fixed' }}>
                <VectorMap map={'ca_lcc'}
                      map={"in_mill"}
                     // backgroundColor="blue"
                      focusOn={{
                        x: 0.5,
                        y: 0.5,
                        scale: 0,
                        animate: false
                      }}
                      zoomOnScroll={true}
                      containerStyle={{
                      width: "100%",
                      height: "700px"
                      }}
                      onRegionClick={this.changeBg()}
                />
            </div>
        );
    }
}

export default App;
